import * as types from './actionTypes';


const initialState = {
    users : [],
    user : {},
    msg : ""
}
const userReducer = (state = initialState,action) =>{
    switch (action.type) {
        case  types.GET_WORKERS:
            return{
                ...state,
                workers : action.payload,
            }
        default:
            return state;
    }
}
export default userReducer;
